var formatUtil = echarts.format;

function getLevelOption() {
    return [{
            visualDimension: 0,
            itemStyle: {
                color: '#009a9c',
                borderWidth: 12,
                borderColor: '#05212c',
                gapWidth: 9,
            }
        },
        {
            itemStyle: {
                borderWidth: 2,
                borderColor: '#034a50',
            }
        }
    ];
}
myChart.setOption(option = {
    tooltip: {
        formatter: function(info) {
            var value = info.value;
            var treePathInfo = info.treePathInfo;
            var treePath = [];
            for (var i = 1; i < treePathInfo.length; i++) {
                treePath.push(treePathInfo[i].name);
            }
            return [
                '<div class="tooltip-title">' + formatUtil.encodeHTML(treePath.join('/')) + '</div>',
                '人数: ' + formatUtil.addCommas(value) + ' 人',
            ].join('');
        }
    },
    series: [{
        name: '人数',
        type: 'treemap',
        visibleMin: 300,
        width: '100%',
        height: '100%',
        zoomToNodeRatio: 0.5 * 0.5,
        upperLabel: {
            show: false
        },
        label: {
            fontSize: 16,
            color: '#fff',
            show: true,
            position: [5, 5],
            formatter: function(params) {
                var arr = [
                    '{association|' + params.data.name + '}',
                    '{peoNum|' + params.data.value + '}' + '人',
                    '{img|}'
                ];
                return arr.join('\n\n');
            },
            rich: {
                association: {
                    fontSize: 16,
                    color: '#fff',
                },
                peoNum: {
                    fontSize: 30,
                    color: '#fff',
                    fontFamily: 'liquidCrystal',
                },
            }
        },
        levels: getLevelOption(),
        data: modalData,
    }]
});
myChart.on('click', function(params) {
    // 控制台打印数据的名称

   
    params.event.target.__cachedNormalStl.fill = "pink";
    params.event.target.style.fill = "pink";
     gztx.queryInfo(params)
});